import smtplib
from email.mime.multipart import MIMEMultipart
from email.mime.text import MIMEText
from email.mime.base import MIMEBase
from email import encoders
import os
import subprocess
import traceback
import time

def get_script_output(scriptpath):
      result = subprocess.run(['python', scriptpath], stdout=subprocess.PIPE, text=True)
      return result.stdout

def send_email(sender_email, sender_password, recipient_emails, subject, body, attachment_path):
      msg = MIMEMultipart()
      msg['From'] = sender_email
      msg['To'] = ', '.join(recipient_emails)
      msg['Subject'] = subject

      msg.attach(MIMEText(body, 'plain'))

      for attachment_path in attachment_paths:
          with open(attachment_path, 'rb') as attachment:
              part = MIMEBase('application', 'octet-stream')
              part.set_payload(attachment.read())
              encoders.encode_base64(part)
              part.add_header('Content-Disposition', f'attachment; filename={os.path.basename(attachment_path)}')
              # part.add_header('Content-Disposition', f'attachment; filename={os.path.basename(attachment_path_1)}')
              msg.attach(part)

      try:
          server = smtplib.SMTP('smtp.office365.com', 587)
          server.starttls()
          server.login(sender_email, sender_password)

          server.sendmail(sender_email, recipient_emails, msg.as_string())

          server.quit()

          print("Email sent successfully!")
      except smtplib.SMTPException as e:
          print(f"SMTP error occurred: {e}")
      except Exception as e:
          print(f"Failed to send email. Error: {e}")


